<script setup lang="ts">
import { onMounted } from 'vue'
import Vivus from 'vivus'
import anime from 'animejs'

const querySvgElement = () => {
	let list = []
	for (let i = 0; i <= 4; i++) {
		list.push(`my-svg${i}`)
	}
	return list
}

const useSvgAnimate: (svgId: string) => Promise<void> = (svgId: string) => {
	return new Promise(resolve => {
		new Vivus(
			svgId,
			{
				type: 'sync',
				duration: 400,
				animTimingFunction: Vivus.EASE
			},
			resolve
		)
	})
}

const useOpacity: (svgNode: HTMLElement) => Promise<void> = (svgNode: HTMLElement) => {
	return new Promise(resolve => {
		svgNode.style.visibility = `visible`
		resolve()
	})
}

const playWelcomeText: () => Promise<void> = () => {
	return new Promise(async resolve => {
		const svgIdList = querySvgElement()
		for await (const svgId of svgIdList) {
			const svgNode = document.querySelectorAll('.welcome-text-word')[svgIdList.indexOf(svgId)] as HTMLElement
			await useOpacity(svgNode)
			await useSvgAnimate(svgId)
		}
		resolve()
	})
}

defineExpose({
	playWelcomeText
})
</script>

